import {useState, useEffect} from 'react'

export const ItemsList =({getItems})=>{
    const [items, setItems] = useState([]);

    useEffect(()=>{
        const newItem = getItems()
        setItems(newItem);
      }, [getItems])

    return (
<>
        {items.map((item) => (
            <div key={item}>{item}</div>
          ))}
    </>
    )
}
